import React from 'react'


const Rating = ({values , text}) => {
  return (
    <div className='rating'>
        <span>
            <i className={
                values >= [1,2,3,4,5]
                    ? 'fas fa-star'
                    : values =[0.5,1.5,2.5,3.5,4.5]
                    ? 'fas fa-star-half-alt'
                    : 'far fa-star'
                    }
            ></i>    
        </span>
   
        <span>{text && text}</span> 

        
    </div>
    
  )
}

export default Rating
